import Header from './Header/Header';
import Body from './Body/Body';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import './css/main.min.css';
import './App.css';

function App() {
  return (
    // <div className='div-main'>
      // <Header/>
    //   <Body/>
    // </div>
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container-fluid">
                <a className=" col-6 col-lg-3" href="#">Cookie Dough</a>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <form className="col-12 col-lg-5 d-flex justify-content-end my-2 my-lg-0">
                        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
                        <button className="btn btn-outline-dark" type="submit">Search</button>
                    </form>
                    <div className="col-12 col-lg-4 d-flex justify-content-center justify-content-lg-end">
                        <ul className="navbar-nav col-12 col-lg-auto mb-2 mb-md-0 bg-light">
                            <li className="nav-item">
                            <a className="nav-link" href="#">Cart</a>
                            </li>
                            <li className= "nav-item dropdown">
                            <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                                Dropdown
                            </a>
                            <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
                                <li><a className="dropdown-item" href="#">My Profile</a></li>
                                <li><a className="dropdown-item" href="#">My Orders</a></li>
                                <li><hr className="dropdown-divider"/></li>
                                <li><a className="dropdown-item" href="#">Log Out</a></li>
                            </ul>
                            </li>
                        </ul>
                    </div>
                    <div className="col-12 col-lg-3 d-flex justify-content-end">
                        <button type="button" className="btn btn-outline-dark me-2">Login</button>
                        <button type="button" className="btn btn-warning">Sign-up</button>
                    </div>
                </div>
            </div>
        </nav>
  );
}

export default App;
